import Message from "../layout/Message.js"
import { useLocation } from "react-router-dom"

function Projects(){

    const location = useLocation()
    message =''
    if(location.State) {
        message = location.State.message
    }

    return(
        <div>
            <h1>Meus Projetos</h1>
            <Message msg = "alguma mensagem " type={"success"}/>
        </div>
    )
}

export default Projects
